import './ExpenseDate.css';

function ExpenseDate(props) {
    const month = props.date.toLocaleString('gr', { month: 'long' })
    const year = props.date.getFullYear()
    const day = props.date.toLocaleString('gr', { day: '2-digit' })

    return (
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    );
}

export default ExpenseDate;
